import React, { Component } from 'react';
import logo from './logo.svg';
import './index.css';
import Navbar from './Component/NavBar';

export default class App extends Component {
  render() {
    return (
      <div className="App">
        <Navbar />
        <body>
          <div className="Greeting">
            Hi, I'm Ploy Pruekcharoen
          </div>
        </body>
      </div>
    );
  }
}
